import React, { useEffect, useState } from 'react';
import { BrowserRouter as Router, Route, Routes, Link, useLocation } from 'react-router-dom';
import Chatbot from './Chatbot';
import Donaciones from './Donaciones.jsx';
import IniciarSecion from './IniciarSesion';
import RegistroCoder from './RegistroCoder';
import SubirReto from './SubirReto';
import reacnative from './Reactnativefoto.png';
import java from './javafoto.png';
import nodejs from './jsfoto.png';
import reactjs from './Reactjsfoto.png';
import php from './phpfoto.png';
import python from './pythonfoto.png';
import inicio from './logofoto.png';
import './App.css';

function App() {
  return (
    <Router>
      <AppContent />
    </Router>
  );
}

function AppContent() {
  const location = useLocation();
  const [isDropdownOpen, setIsDropdownOpen] = useState(false);

  useEffect(() => {
    // Scroll smoothly to comments section if the route is '/comentarios'
    if (location.pathname === '/comentarios') {
      const comentariosSection = document.getElementById('comentarios');
      if (comentariosSection) {
        comentariosSection.scrollIntoView({ behavior: 'smooth' });
      }
    }
  }, [location]);

  const toggleDropdown = () => {
    setIsDropdownOpen(!isDropdownOpen);
  };

  return (
    <div className="app">
      <header className="app-header">
        <nav className="navbar">
          <div className="nav-left">
            <div className="logo-container">
              <Link to="/">
                <img src={inicio} alt="Inicio" className="logo" />
              </Link>
            </div>
            <ul className="nav-links">
              <li className="nav-item"><Link to="/donaciones">Donaciones</Link></li>
              <li className="nav-item"><Link to="/sobre-nosotros">Sobre nosotros</Link></li>
              <li className="nav-item"><Link to="/comentarios">Comentarios</Link></li>
              <li className="nav-item"><Link to="/chatbot">Chat bot</Link></li>
              <li className="nav-item"><Link to="/subirreto">Subir reto</Link></li>
              <li className="nav-item"><Link to="/iniciarsecion">Iniciar sesión</Link></li>
              <li className="nav-item"><Link to="/registrocoder">Registro coder</Link></li>
            </ul>
          </div>
          <div className="nav-right">
            <button className="create-challenge-btn">+ Crear reto</button>
            <div className="user-profile" onClick={toggleDropdown}>
              <img src="path-to-your-avatar.png" alt="User Avatar" className="user-avatar" />
              <span className="dropdown-arrow">▼</span>
              {isDropdownOpen && (
                <div className="dropdown-menu">
                  <ul>
                    <li><Link to="/profile">Perfil</Link></li>
                    <li><Link to="/logout">Cerrar sesión</Link></li>
                  </ul>
                </div>
              )}
            </div>
          </div>
        </nav>
      </header>

      {/* Rutas */}
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/donaciones" element={<Donaciones />} />
        <Route path="/comentarios" element={<HomePage />} />
        <Route path="/chatbot" element={<Chatbot />} />
        <Route path="/subirreto" element={<SubirReto />} />
        <Route path="/iniciarsecion" element={<IniciarSecion />} />
        <Route path="/registrocoder" element={<RegistroCoder />} />
      </Routes>
    </div>
  );
}

function HomePage() {
  return (
    <main className="main-content">
      {/* El contenido de la página principal */}
      {/* ... */}
    </main>
  );
}

export default App;
